import "./caerdserie.css"

export const Cardseries = () => {
   
const Data = [

  { id:1 , img:'/series/Dirilis.jpg' , alt:'dirilis' , url:'/diri'},
  { id:2 , img:'/series/payith.jpg' , alt:'payith' },
  { id:3 , img:'/series/copadam/copadam.jpg' , alt:'copadam' , url:'./copadam' },
  { id:4 , img:'/series/kuruluuus.jpg' , alt:'kurulus'},
  { id:5 , }
]
  

  return (

  <div>
    {Data.map((item)=>{
      return(
    
    <div className='card-container'  >
        <div className='image-container'>
        <a href={item.url}> <img src={item.img} alt={item.alt} /> </a>
        </div>
    </div>

      );
  } )}
    </div>
  )
}
